import React, { useState } from 'react';
import './style1.css';
const NavBar = () => {
  const [visible, setVisible] = useState(false);

  const toggleNavBar = () => {
    setVisible(!visible);
  };

  return (
    <div>
      <button onClick={toggleNavBar}>Toggle Navbar</button>
      {visible && (
        <div style={{ position: 'fixed', top: 0, right: 0, width: '200px', height: '100%', backgroundColor: 'gray' }} className='right-navbar'>
          {/* Navbar content */}
          <ul>
            <li>Link 1</li>
            <li>Link 2</li>
            <li>Link 3</li>
          </ul>
        </div>
      )}
      {/* Rest of the website */}
      <div style={{ marginLeft: visible ? '200px' : 0 }}>
        <h1>Website Content</h1>
      </div>
    </div>
  );
};

export default NavBar;
